import React from "react";
import ''
const AboutMe = () => {
    return(
        <div>
        <h1 className="white tc">About me</h1>

        <p className="white tc f4">Greetings, I am a software engineering 
        student located in Albania,
        deeply immersed in the realm 
        of coding and innovation. <br/> Through this platform,
        I present a collection of personal projects that 
        stand as a testament to my journey of translating 
        concepts into practical digital solutions. <br/> I invite
        you to explore my portfolio and witness the synergy
        of creativity and technology at work.</p>
        </div>
    )
}

export default AboutMe;
